import React from "react";
import Day from "./Day";

const Month = ({courses}) => {
    const dayElement = courses.map( course =>
        <li key={course.date}><Day course={course}/></li>
    )
    return (
        <ul>
            {dayElement}
        </ul>

    )
}
export default Month;
